export default function BurritoLeagueStats({
  segmentName,
}: BurritoLeagueStatsProps) {
  const { theme } = useTheme();
  const [csvData, setCsvData] = useState<string>(defaultCSV || "");
  const [viewType, setViewType] = useState<"overview" | "users" | "timeline">(
    "overview"
  );

  const viewOptions = [
    { label: "Overview", value: "overview" },
    { label: "By User", value: "users" },
    { label: "Timeline", value: "timeline" },
  ];

  const efforts = useMemo<SegmentEffort[]>(() => {
    if (!csvData) return [];
    try {
      return parseSegmentEffortsCSV(csvData);
    } catch (error) {
      console.error("Error parsing CSV:", error);
      return [];
    }
  }, [csvData]);

  const overallStats = useMemo<SegmentStats>(() => {
    if (!efforts || efforts.length === 0) {
      return {
        totalCompletions: 0,
        totalDistance: 0,
        totalMovingTime: 0,
        totalElapsedTime: 0,
        averageCompletions: 0,
        averageDistance: 0,
        averageMovingTime: 0,
        fastestTime: 0,
        slowestTime: 0,
        uniqueUsers: 0,
        uniqueActivities: 0,
      };
    }

    const totalCompletions = efforts.reduce(
      (sum, e) => sum + e.segmentCompletions,
      0
    );
    const totalDistance = efforts.reduce((sum, e) => sum + e.distance, 0);
    const totalMovingTime = efforts.reduce((sum, e) => sum + e.movingTime, 0);
    const totalElapsedTime = efforts.reduce((sum, e) => sum + e.elapsedTime, 0);
    const uniqueUsers = new Set(efforts.map((e) => e.userId)).size;
    const uniqueActivities = new Set(efforts.map((e) => e.activityId)).size;

    const movingTimes = efforts.map((e) => e.movingTime);
    const fastestTime = Math.min(...movingTimes);
    const slowestTime = Math.max(...movingTimes);

    return {
      totalCompletions,
      totalDistance,
      totalMovingTime,
      totalElapsedTime,
      averageCompletions: totalCompletions / efforts.length,
      averageDistance: totalDistance / efforts.length,
      averageMovingTime: totalMovingTime / efforts.length,
      fastestTime,
      slowestTime,
      uniqueUsers,
      uniqueActivities,
    };
  }, [efforts]);

  const userStats = useMemo<UserSegmentStats[]>(() => {
    if (!efforts || efforts.length === 0) return [];

    const grouped = efforts.reduce<Record<string, SegmentEffort[]>>(
      (acc, effort) => {
        if (!acc[effort.userId]) {
          acc[effort.userId] = [];
        }
        acc[effort.userId].push(effort);
        return acc;
      },
      {}
    );

    return Object.entries(grouped)
      .map(([userId, userEfforts]) => {
        const totalCompletions = userEfforts.reduce(
          (sum, e) => sum + e.segmentCompletions,
          0
        );
        const totalDistance = userEfforts.reduce(
          (sum, e) => sum + e.distance,
          0
        );
        const totalMovingTime = userEfforts.reduce(
          (sum, e) => sum + e.movingTime,
          0
        );
        const totalElapsedTime = userEfforts.reduce(
          (sum, e) => sum + e.elapsedTime,
          0
        );
        const fastestTime = Math.min(...userEfforts.map((e) => e.movingTime));

        return {
          userId,
          totalCompletions,
          totalDistance,
          totalMovingTime,
          totalElapsedTime,
          fastestTime,
          activities: userEfforts.length,
          efforts: userEfforts.sort(
            (a, b) =>
              new Date(a.startDate).getTime() - new Date(b.startDate).getTime()
          ),
        };
      })
      .sort((a, b) => b.totalCompletions - a.totalCompletions);
  }, [efforts]);

  const timelineData = useMemo(() => {
    if (!efforts || efforts.length === 0) return null;

    const grouped = efforts.reduce<Record<string, SegmentEffort[]>>(
      (acc, effort) => {
        const date = new Date(effort.startDateLocal)
          .toISOString()
          .split("T")[0];
        if (!acc[date]) {
          acc[date] = [];
        }
        acc[date].push(effort);
        return acc;
      },
      {}
    );

    const sortedDates = Object.keys(grouped).sort();
    const labels = sortedDates.map((date) =>
      new Date(date).toLocaleDateString()
    );
    const completionsData = sortedDates.map((date) =>
      grouped[date].reduce((sum, e) => sum + e.segmentCompletions, 0)
    );
    const distanceData = sortedDates.map((date) =>
      grouped[date].reduce((sum, e) => sum + e.distance / 1000, 0)
    );
    const activitiesData = sortedDates.map((date) => grouped[date].length);

    return {
      labels,
      datasets: [
        {
          label: "Segment Completions",
          data: completionsData,
          borderColor: "#60a5fa",
          backgroundColor: "rgba(96,165,250,0.2)",
          yAxisID: "y",
          tension: 0.4,
        },
        {
          label: "Distance ()",
          data: distanceData,
          borderColor: "#34d399",
          backgroundColor: "rgba(52,211,153,0.2)",
          yAxisID: "y1",
          tension: 0.4,
        },
      ],
    };
  }, [efforts]);

  const chartOptions = {
    responsive: true,
    maintainAspectRatio: false,
    interaction: {
      mode: "index" as const,
      intersect: false,
    },
    plugins: {
      legend: {
        labels: {
          color: theme === "dark" ? "#e5e7eb" : "#374151",
        },
      },
    },
    scales: {
      y: {
        type: "linear" as const,
        display: true,
        position: "left" as const,
        ticks: {
          color: theme === "dark" ? "#9ca3af" : "#6b7280",
        },
        grid: {
          color: theme === "dark" ? "rgba(255,255,255,0.1)" : "rgba(0,0,0,0.1)",
        },
      },
      y1: {
        type: "linear" as const,
        display: true,
        position: "right" as const,
        ticks: {
          color: theme === "dark" ? "#9ca3af" : "#6b7280",
        },
        grid: {
          drawOnChartArea: false,
        },
      },
      x: {
        ticks: {
          color: theme === "dark" ? "#9ca3af" : "#6b7280",
        },
        grid: {
          color: theme === "dark" ? "rgba(255,255,255,0.1)" : "rgba(0,0,0,0.1)",
        },
      },
    },
  };

  const formatTime = (seconds: number) => {
    const hours = Math.floor(seconds / 3600);
    const minutes = Math.floor((seconds % 3600) / 60);
    const secs = seconds % 60;
    if (hours > 0) return `${hours}h ${minutes}m ${secs}s`;
    if (minutes > 0) return `${minutes}m ${secs}s`;
    return `${secs}s`;
  };

  const formatDistance = (meters: number) => {
    const km = meters / 1000;
    return `${(km * 0.621371).toFixed(2)} mi`;
  };

  const formatPace = (meters: number, seconds: number) => {
    if (meters === 0) return "N/A";
    const paceSecondsPerMi = (seconds / meters) * 1609.34;
    const mins = Math.floor(paceSecondsPerMi / 60);
    const secs = Math.floor(paceSecondsPerMi % 60);
    return `${mins}:${secs.toString().padStart(2, "0")} /mi`;
  };

  const handleFileUpload = (event: any) => {
    const file = event.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        const text = e.target?.result as string;
        setCsvData(text);
      };
      reader.readAsText(file);
    }
  };

  const cardBg =
    theme === "dark"
      ? "bg-gray-800 border-gray-700 text-gray-100"
      : "bg-white border-gray-200 text-gray-900";

  return (
    <div className="flex flex-col gap-4 w-full max-w-7xl mx-auto p-4">
      <Card className={cardBg}>
        <div className="flex flex-col gap-4">
          <div className="flex items-center justify-between flex-wrap gap-4">
            <div>
              <h1 className="text-3xl font-bold mb-2">
                üåØ {segmentName || "Burrito League"} Stats
              </h1>
              <p className="text-gray-600 dark:text-gray-400">
                {efforts.length} activities ‚Ä¢ {overallStats.uniqueUsers}{" "}
                athletes ‚Ä¢ {overallStats.uniqueActivities} unique activities
              </p>
              <p className="text-gray-600 dark:text-gray-400">
                Join your segment leaderboard on the map above to contribute!
              </p>
            </div>
            <SelectButton
              value={viewType}
              onChange={(e) => setViewType(e.value)}
              options={viewOptions}
              className="flex-shrink-0"
            />
          </div>

          {!csvData && (
            <div className="p-4 bg-blue-50 dark:bg-blue-900/20 rounded-lg">
              <FileUpload
                mode="basic"
                name="csv"
                accept=".csv"
                maxFileSize={1000000}
                onSelect={handleFileUpload}
                chooseLabel="Upload CSV Data"
                className="w-full"
              />
              <p className="text-sm text-gray-600 dark:text-gray-400 mt-2">
                Upload a CSV file with segment effort data
              </p>
            </div>
          )}

          {efforts.length > 0 && (
            <div className="grid grid-cols-2 md:grid-cols-5 gap-4 mt-4">
              <div className="p-4 bg-blue-50 dark:bg-blue-900/20 rounded-lg">
                <div className="text-sm text-gray-600 dark:text-gray-400">
                  Total Segments
                </div>
                <div className="text-2xl font-bold text-blue-600 dark:text-blue-400">
                  {overallStats.totalCompletions}
                </div>
              </div>
              <div className="p-4 bg-green-50 dark:bg-green-900/20 rounded-lg">
                <div className="text-sm text-gray-600 dark:text-gray-400">
                  Total Distance
                </div>
                <div className="text-2xl font-bold text-green-600 dark:text-green-400">
                  {formatDistance(overallStats.totalDistance)}
                </div>
              </div>
              <div className="p-4 bg-purple-50 dark:bg-purple-900/20 rounded-lg">
                <div className="text-sm text-gray-600 dark:text-gray-400">
                  Fastest Segment
                </div>
                <div className="text-2xl font-bold text-purple-600 dark:text-purple-400">
                  {formatTime(overallStats.fastestTime)}
                </div>
              </div>
              <div className="p-4 bg-orange-50 dark:bg-orange-900/20 rounded-lg">
                <div className="text-sm text-gray-600 dark:text-gray-400">
                  Avg Moving Time
                </div>
                <div className="text-2xl font-bold text-orange-600 dark:text-orange-400">
                  {formatTime(Math.round(overallStats.averageMovingTime))}
                </div>
              </div>
              <div className="p-4 bg-pink-50 dark:bg-pink-900/20 rounded-lg">
                <div className="text-sm text-gray-600 dark:text-gray-400">
                  Athletes
                </div>
                <div className="text-2xl font-bold text-pink-600 dark: text-pink-400">
                  {overallStats.uniqueUsers}
                </div>
              </div>
            </div>
          )}
        </div>
      </Card>

      {efforts.length > 0 && (
        <Card className={cardBg}>
          {viewType === "overview" && (
            <div className="flex flex-col gap-6">
              <div>
                <h2 className="text-xl font-bold mb-4">Activity Timeline</h2>
                <div style={{ height: "200px" }}>
                  {timelineData && (
                    <Chart
                      type="line"
                      data={timelineData}
                      options={chartOptions}
                    />
                  )}
                </div>
              </div>

              <div>
                <h2 className="text-xl font-bold mb-4">Recent Activities</h2>
                <DataTable
                  value={efforts.slice(0, 20)}
                  paginator
                  rows={10}
                  className="text-sm"
                  sortField="startDateLocal"
                  sortOrder={-1}
                >
                  <Column
                    field="activityName"
                    header="Activity"
                    body={(row: SegmentEffort) => (
                      <div>
                        <div className="font-semibold">
                          <Link
                            href={`https://strava.com/activities/${row.activityId}`}
                            target="_blank"
                            rel="noopener noreferrer"
                            className="no-underline hover:underline-offset-2 hover:text-orange-500"
                          >
                            {row.activityName}
                          </Link>
                        </div>
                        <div className="text-xs text-gray-500">
                          {new Date(row.startDateLocal).toLocaleString()}
                        </div>
                      </div>
                    )}
                    sortable
                  />
                  <Column
                    field="segmentCompletions"
                    header="Completions"
                    body={(row: SegmentEffort) => (
                      <span className="font-bold text-blue-600 dark:text-blue-400">
                        {row.segmentCompletions}
                      </span>
                    )}
                    sortable
                  />
                  <Column
                    field="distance"
                    header="Distance"
                    body={(row: SegmentEffort) => formatDistance(row.distance)}
                    sortable
                  />
                  <Column
                    field="movingTime"
                    header="Moving Time"
                    body={(row: SegmentEffort) => formatTime(row.movingTime)}
                    sortable
                  />
                  <Column
                    header="Pace"
                    body={(row: SegmentEffort) =>
                      formatPace(row.distance, row.movingTime)
                    }
                  />
                </DataTable>
              </div>
            </div>
          )}

          {viewType === "users" && (
            <div>
              <h2 className="text-xl font-bold mb-4">Athletes Leaderboard</h2>
              <DataTable value={userStats} paginator rows={20}>
                <Column
                  header="Rank"
                  body={(_, { rowIndex }) => (
                    <span className="font-bold text-lg">
                      {rowIndex === 0 && "ü•á"}
                      {rowIndex === 1 && "ü•à"}
                      {rowIndex === 2 && "ü•â"}
                      {rowIndex > 2 && `#${rowIndex + 1}`}
                    </span>
                  )}
                />
                <Column
                  field="userId"
                  header="Athlete ID"
                  body={(row: UserSegmentStats) => (
                    <div className="font-mono text-xs">
                      {row.userId.substring(0, 8)}...
                    </div>
                  )}
                />
                <Column
                  field="totalCompletions"
                  header="Completions"
                  body={(row: UserSegmentStats) => (
                    <span className="font-bold text-blue-600 dark:text-blue-400">
                      {row.totalCompletions}
                    </span>
                  )}
                  sortable
                />
                <Column field="activities" header="Activities" sortable />
                <Column
                  field="totalDistance"
                  header="Total Distance"
                  body={(row: UserSegmentStats) =>
                    formatDistance(row.totalDistance)
                  }
                  sortable
                />
                <Column
                  field="totalMovingTime"
                  header="Total Time"
                  body={(row: UserSegmentStats) =>
                    formatTime(row.totalMovingTime)
                  }
                  sortable
                />
                <Column
                  field="fastestTime"
                  header="Fastest"
                  body={(row: UserSegmentStats) => formatTime(row.fastestTime)}
                  sortable
                />
              </DataTable>
            </div>
          )}

          {viewType === "timeline" && (
            <div className="flex flex-col gap-6">
              <div>
                <h2 className="text-xl font-bold mb-4">Daily Activity</h2>
                <div style={{ height: "500px" }}>
                  {timelineData && (
                    <Chart
                      type="line"
                      data={timelineData}
                      options={chartOptions}
                    />
                  )}
                </div>
              </div>

              <div>
                <h2 className="text-xl font-bold mb-4">
                  All Activities (Chronological)
                </h2>
                <DataTable
                  value={[...efforts].sort(
                    (a, b) =>
                      new Date(b.startDateLocal).getTime() -
                      new Date(a.startDateLocal).getTime()
                  )}
                  paginator
                  rows={25}
                  className="text-sm"
                >
                  <Column
                    field="startDateLocal"
                    header="Date"
                    body={(row: SegmentEffort) => (
                      <span className="text-xs">
                        {new Date(row.startDateLocal).toLocaleString()}
                      </span>
                    )}
                    sortable
                  />
                  <Column field="activityName" header="Activity" sortable />
                  <Column field="segmentCompletions" header="Comp." sortable />
                  <Column
                    field="distance"
                    header="Distance"
                    body={(row: SegmentEffort) => formatDistance(row.distance)}
                    sortable
                  />
                  <Column
                    field="movingTime"
                    header="Time"
                    body={(row: SegmentEffort) => formatTime(row.movingTime)}
                    sortable
                  />
                  <Column
                    field="elapsedTime"
                    header="Elapsed"
                    body={(row: SegmentEffort) => formatTime(row.elapsedTime)}
                    sortable
                  />
                </DataTable>
              </div>
            </div>
          )}
        </Card>
      )}
    </div>
  );
}
